import React from "react";
import '../css/App.css';
import { connect } from "react-redux";
import RootReducer from "../reducer/RootReducer"


export default class CarImageAndInformation extends React.Component
{
  constructor(props)
  {
    super(props);
    this.state = {
      carName: "Swift",
      photoList : ["./swift_1.jpg","./swift_2.jpg","./swift_3.jpg"]
    };
  }
  render()
  {
    // const image_list = this.state.photoList.map(photo => {
    //   <img src={""+photo+""} className="Swift"></img>
    // });
    return(
      <div className="ImgAndInfo">


      <div className="CarImage">
        <div className="Bs6">BS6 (some versions)</div>
        <img src="./group.svg" className="Group"></img>
        <img src={this.props.selectedVersion.imageUrl} className="Swift"></img>
        {/* {image_list}        */}
      </div>
      <div className="CarInformation">
        <div className="Color">
          <img src="./colors.svg" className="info-icon"></img>
          <p className="car-info">Color</p>
        </div>
        <div className="Image">
          <img src="./image.svg" className="info-icon"></img>
          <p className="car-info">Image</p>
        </div>
        <div className="Video">
          <img src="./video.svg" className="info-icon"></img>
          <p className="car-info">Video</p>
        </div>
        <div className="View">
          <img src="./view.svg" className="info-icon"></img>
          <p className="car-info">View</p>
        </div>
      </div>

      </div>
    )
  }
}
